import React, { Component } from 'react';

class EventsList extends Component {
    state = {
        users: []
    }

    async FetchAllEvents() {
        const response = await fetch('/users');
        const body = await response.json();
        this.setState({users: body});
    }

    render() {
        return(
            <>
                <h1>Hello</h1>
            </>
        )
    }
}

export default EventsList
